Description:
Якісне персоналізоване системне рекрутингове агентство.


Що Ви отримаєте?


1. Перевірені порядні роботодавці;


2. У наших вакансіях дійсно зрозуміло про роботодавців і що Ви робитимете;


3.

We focus on sourcing to find the right candidate as quickly as possible;


We conduct an interview where we also present the company and the vacancy; 


We prepare the cover letter — our recruiter’s assessment of the technical and non-technical relevance...

IT-подразделение компании Leader-group специализируется в нескольких областях разработки:



создание веб-проектов средних размеров, ориентированных на продажу широкому кругу клиентов; 
разработка проектов различного масштаба, предназначенных как для внутреннего...

Деятельность компании можно разделить на три направления:


1.	разработка нестандартных масштабируемых интернет-проектов кастомного функционала, начиная от интернет-представительств компаний, заканчивая крупными социальными сетями и сервисами;


2.

SoftUkraine — компания, предлагающая полный набор услуг по разработке, внедрению и сопровождению веб-проектов. В своей деятельности компания концентрирует внимание на четырех ключевых сущностях:
—  Клиент;
—  Разработчик;
—  Качество;
—  Цена.
